import axios from "axios";
export const Newmember = memberID => {
  axios
    .post(
      "http://localhost:8080/projects/sanctuary/server/public/add",
      memberID
    )
    .then(res => {
      this.setState({ newMember: res.data });
      console.log(this.state.newMember);
    })
    .catch(err => {
      console.log(err);
    });
};
